import React from "react";
// Output the ID of the selected event on the EventDetailPage
import { useParams } from "react-router-dom";

function EventDetailPage() {
  return (
    <>
      <h1>EventDetailPage</h1>
      <p>Event ID:{use}</p>
    </>
  );
}

export default EventDetailPage;
